import React from 'react'
import {useNavigate} from 'react-router-dom'

function ErrorPage() {
  const navigate = useNavigate();
const goback = () =>{
navigate('/');
} ;
  
  return (
    <>
      <div id='error'>
        <h2>404</h2>
        <h3>ERROR</h3>
        <p>Page Not found </p>
      </div>
      <button id='btn' onClick={()=>goback()}>Go Back</button>
    </>
  )
}

export default ErrorPage
